import Button from "./Button.js";
import "./css/reset.css";
import "./css/style.css";

function App()  {
  return (
    <div>
      <div>
        <h1 className="title">Beomsoo Kim</h1>
        <p className="main-text">Hello! My name is Beomsoo kim and I am Web Publisher in Korea</p>
        <Button text={"Continue"} />
      </div>
    </div>
  );
}

export default App;
